TEST(String16Test, RemoveOutOfBounds) {
    String16 tmp("Verify me");
    tmp.remove(100, 6);
    EXPECT_EQ(3U, tmp.size());
    EXPECT_STR16EQ(u" me", tmp);
}

base_contents:
TEST(String16Test, MakeLower) {
    String16 tmp("Verify Me!");
    tmp.makeLower();
    EXPECT_EQ(10U, tmp.size());
    EXPECT_STR16EQ(u"verify me!", tmp);
}

